values:
It rained the day my father died. Or at least the day I found out he died. Or did it snow? I know it snowed later. I know it snowed the day we buried him. But it doesn't fucking matter whether it snowed or rained does it?&nbsp;

My face rained the moment I found out, but then my face wouldn't rain later when I wanted it to. It wants to now.&nbsp;

It has been just over a month and with each day I feel the pain and emptiness of it getting worse, not better.&nbsp;

Does it seem more real now because the worrying about the rest of my family is lessened slightly, or that the stress of my medical school interview ended yesterday, or that I finally realize that I will never see him again? &nbsp;

Dad had 524 facebook friends the day after he passed, now he has 468 - I find that comical. PEOPLE.&nbsp;

After my interview I went to visit Dad on the last street he will ever be on - Oram. &nbsp;I thought I would be fine - fine enough anyway. First I got upset that I could not find him. The snow up to the knees has finally melted, so I no longer had the path of my footsteps inside those of my brothers. All the stones are flat - it's disorienting. I remember now that he is near a birch tree to the right of the &quot;chapel&quot; Then I got upset that I found him. I cried so hard for so long. I threw dirt. I thought my brains were going to explode out of my head. I could have stayed there and cried for hours...days even. I am sure the joggers heard me wailing, saw the mascara smeared across my face. F &nbsp;them, that's what they get for exercising in a place of remembrance and grief.&nbsp;

I can't believe it. I just can't.&nbsp;

46. His parents rest near him - his mother was 47 when she passed.&nbsp;

At the viewing it did not look like him. Of course it didn't. &nbsp;As I watched them lower the casket into the ground I thought that would help with closure. Has it? Though bringing the dump truck of dirt right over and pouring it on top of him while the entire family watched - that was not necessary.&nbsp;

Sorry you weren't buried naked and ass end up like you hoped dad. Mom did not think it was proper. &nbsp;But we put your pack of&nbsp;cigarettes&nbsp;in your pocket and threw a coffee into the ground with you - extra extra sugar, extra extra cream.&nbsp;

Happy first day of spring I guess.&nbsp;
